import React from 'react';

import './MiniBlock.sass';

function MiniBlock(props) {
  let className = props.className === null || undefined ? "mini-block" : "mini-block" + props.className;
  return(
    <div id={props.id} className={className}>{props.childrens}</div>
  );
}

export default MiniBlock;
